export const JAVASCRIPT = [
    {
        id: 0,
        question: "Explain 'this' keyword.",
        answer: "The JavaScript 'this' keyword refers to the object it belongs to.",
        source: "https://www.w3schools.com/js/js_this.asp"
    },
    {
        id: 1,
        question: "Explain Higher Order Functions in JavaScript.",
        answer: "Functions that operate on other functions, either by taking them as arguments or by returning them, are called higher-order functions.",
        source: "https://eloquentjavascript.net/05_higher_order.html"
    },
    {
        id: 2,
        question: "What are callbacks?",
        answer: "A callback is a function that will be executed after another function gets executed.",
        source: "https://developer.mozilla.org/en-US/docs/Glossary/Callback_function"    
    },
    {
        id: 3,
        question: "What are object prototypes?",
        answer: "Prototypes are the mechanism by which JavaScript objects inherit features from one another",
        source: "https://developer.mozilla.org/en-US/docs/Learn/JavaScript/Objects/Object_prototypes"
    }
];
